import React, { useState } from 'react';
import { FaBell } from 'react-icons/fa';
import '../assets/styles/Notification.css';

const GroupList = ({ notifications }) => {
  const [showGroupList, setShowGroupList] = useState(false);

  const toggleGroupList = () => {
    setShowGroupList(!showNotifications);
  };

  return (
    <div className="group-list">
      <button onClick={toggleNotifications} className="group-list-button">
        <FaBell /> Notifications
      </button>
      <div className={`group-list-dropdown ${showNotifications ? 'show' : ''}`}>
        {notifications.length === 0 ? (
          <p className="group-list-item">No new notifications</p>
        ) : (
          notifications.map((notification, index) => (
            <div key={index} className="group-list-item">
              {notification}
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default GroupList;
